import React, { Component } from "react";
import Car from '../../immagini/CAR.png';
import '../../App.css';
import AccessTimeIcon from '@material-ui/icons/AccessTime';
import { green } from '@material-ui/core/colors';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import MapIcon from '@material-ui/icons/Map';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, setCurrentUser } from "../../actions/authAutentications";
import car from '../../immagini/CAR.png';
import { Container, Row, Col } from 'react-bootstrap';
import EuroIcon from '@material-ui/icons/Euro';
import ExploreIcon from '@material-ui/icons/Explore';
import ScheduleIcon from '@material-ui/icons/Schedule';

class HomeCliente extends Component {

  constructor(props) {
    super(props);
  }


   onLogoutClick = e => {
      e.preventDefault();
      this.props.logoutUser();
   };
   

   render(){ 
    const { user } = this.props.auth;

    //Redirect
    if(user.ruolo==='Admin')
    this.props.history.push("/Dashboard");
      return( 
         <div className='HomeCliente'> 
            <Container>
  <Row>
    <Col sm={6}>
      <h1 style={{fontWeight: 'bold'}} className="TestoHomeCliente">Il passaggio di cui <br />hai bisogno <br />e molto altro<h4 style={{fontWeight: '300'}} >Richiedi una corsa, sali sul veicolo e goditi il viaggio.</h4></h1>
    </Col>
    <Col sm={6}><img src={car} alt="fiat-500" className='Fiat'/></Col>
  </Row>
        <br /> <br /> <br /> <br />
  <Row>
    <Col sm={12}>
      <h1 style={{fontWeight: 'bolder', textAlign: 'center'}}> Trova il mezzo per andare dove vuoi </h1>
    </Col>
  </Row>
  <br /> <br />
  <Row>
    <Col sm><ScheduleIcon style={{ fontSize: 60, color: "white" }}/></Col>
    <Col sm><EuroIcon style={{ fontSize: 60, color: "white" }}/></Col>
    <Col sm><ExploreIcon style={{ fontSize: 60, color: "white" }}/></Col>
  </Row>
</Container>  

         </div>
      ); 
   } 
}

HomeCliente.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
  };
  
  const mapStateToProps = state => ({
    auth: state.auth
  });
  
  export default connect(
    mapStateToProps,
    { logoutUser }
  )(HomeCliente);
